from typing import List

class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        n, m = len(s), len(t)
        i = j = 0

        while i < n and j < m:
            if s[i] == t[j]:
                i += 1;
                j += 1;
            else:
                j += 1
        return i == n

t = ""
s = "bcd"

sol = Solution()
print(sol.isSubsequence(s,t))